INSERT INTO `projects` (`id`, `name`, `description`, `owner_id`, `status`, `start_date`, `end_date`, `budget`, `created_at`, `updated_at`) VALUES
(1, 'Project-III', 'The morning light filtered through the windows, casting soft shadows across the room. Outside, the city was already awake, humming with distant traffic and quiet conversations. It felt like the beginning of something new, a moment suspended between intention and action.\r\nAs the day unfolded, small details began to matter more than expected. A brief exchange of words, the rhythm of footsteps on the sidewalk, and the steady passing of time all blended into a familiar routine. There was comfort in that predictability, even as subtle changes hinted at growth.\r\nBy evening, the atmosphere shifted once again. Reflections replaced urgency, and the noise of the day gave way to calm. In that stillness, it became clear that progress often comes not from dramatic events, but from consistent, thoughtful steps forward.\r\nIf you want a different tone (formal, academic, creative, or technical), I can adjust it easily.', 1, 'active', NULL, NULL, NULL, '2026-01-17 22:58:51', '2026-01-17 22:58:51'),
(2, 'ad', 'asd', 1, 'active', NULL, NULL, NULL, '2026-01-17 23:17:44', '2026-01-17 23:17:44'),
(3, 'Project-IV', 'Here is some description for this project.', 1, 'active', NULL, NULL, NULL, '2026-01-18 13:41:29', '2026-01-18 15:02:28'),
(4, 'A Project with ambitions', '', 1, 'active', NULL, NULL, NULL, '2026-01-18 15:13:21', '2026-01-18 15:13:21');
INSERT INTO `projects` (`id`, `name`, `description`, `owner_id`, `status`, `start_date`, `end_date`, `budget`, `created_at`, `updated_at`) VALUES
(5, 'MBL Upgrade', '<p>Every successful project begins with a clear vision. Defining goals early helps teams align their efforts and avoid unnecessary complexity. When direction is shared, progress becomes easier to measure and sustain.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\" width=\"482\" style=\"\"></p><p>Communication is the bridge between planning and execution. Transparent updates and open feedback reduce misunderstandings and strengthen collaboration. Strong communication turns individual contributions into collective momentum.</p><p>Consistency plays a key role in building trust. Whether in services, products, or internal operations, predictable outcomes create confidence among users and stakeholders. Over time, consistency becomes a defining characteristic of reliability.</p><p>Innovation, however, requires room for experimentation. Organizations that encourage curiosity and learning are better equipped to respond to change. Small, thoughtful improvements often lead to meaningful long-term impact.</p><p>In the end, balance defines success. Combining clarity with flexibility, structure with creativity, allows teams to grow without losing focus. This balance is what transforms good ideas into lasting results.</p>', 1, 'active', NULL, NULL, NULL, '2026-01-18 15:50:19', '2026-01-18 15:50:19');
INSERT INTO `projects` (`id`, `name`, `description`, `owner_id`, `status`, `start_date`, `end_date`, `budget`, `created_at`, `updated_at`) VALUES
(6, 'API Test Project - Automated Testing', '<p>This is a test project created by the automated API testing script.</p><h3>Purpose:</h3><ul><li>Test project creation endpoint</li><li>Validate API response</li><li>Verify data persistence</li></ul>', 1, 'active', NULL, NULL, NULL, '2026-01-18 18:18:03', '2026-01-18 18:18:03'),
(8, 'Mobile App Redesign', '<p>Complete redesign of the mobile application with modern UI/UX principles.</p>', 1, '', NULL, NULL, NULL, '2026-01-18 18:30:26', '2026-01-18 18:30:26'),
(9, 'Customer Portal Development', '<p>Develop a comprehensive self-service customer portal to enhance user experience.</p>', 1, 'active', NULL, NULL, NULL, '2026-01-18 18:33:43', '2026-01-18 18:33:43'),
(10, 'Mobile App Redesign', '<p>Complete redesign of the mobile application with modern UI/UX principles.</p>', 1, '', NULL, NULL, NULL, '2026-01-18 18:33:43', '2026-01-18 18:33:43'),
(11, 'E-Commerce Platform Redesign', '<h2>Project Overview</h2><p>Complete overhaul of the existing e-commerce platform with modern technologies and improved user experience.</p><h3>Key Objectives</h3><ul><li>Implement responsive design for mobile devices</li><li>Integrate advanced search and filtering capabilities</li><li>Optimize checkout process to reduce cart abandonment</li><li>Implement real-time inventory management</li></ul><h3>Technologies</h3><p>React 18, Node.js, PostgreSQL, Redis, Elasticsearch</p>', 1, 'active', NULL, NULL, NULL, '2026-01-18 18:38:26', '2026-01-18 18:38:26'),
(12, 'Healthcare Management System', '<h2>Project Overview</h2><p>Comprehensive healthcare management system for hospitals and clinics to streamline patient care and administrative processes.</p><h3>Key Features</h3><ul><li>Patient registration and medical records management</li><li>Appointment scheduling and calendar integration</li><li>Billing and insurance claims processing</li><li>Electronic prescription management</li><li>Lab results and diagnostics tracking</li></ul><h3>Compliance</h3><p>HIPAA compliant, secure data encryption, audit logging</p>', 1, '', NULL, NULL, NULL, '2026-01-18 18:38:26', '2026-01-18 18:38:26'),
(13, 'Real Estate Listing Portal', '<h2>Project Overview</h2><p>Modern real estate platform connecting buyers, sellers, and agents with advanced property search and virtual tour capabilities.</p><h3>Key Features</h3><ul><li>Advanced property search with map integration</li><li>Virtual tours and 360-degree photography</li><li>Mortgage calculator and financing tools</li><li>Agent directory and messaging system</li><li>Property comparison and favorites</li></ul><h3>Tech Stack</h3><p>Vue.js 3, Laravel, MySQL, AWS S3, Google Maps API</p>', 1, 'active', NULL, NULL, NULL, '2026-01-18 18:38:26', '2026-01-18 18:38:26'),
(14, 'Corporate Training Platform', '<h2>Project Overview</h2><p>Online learning management system for corporate training and employee development with certification tracking.</p><h3>Features</h3><ul><li>Course creation and content management</li><li>Video streaming and interactive lessons</li><li>Quizzes, assessments, and certifications</li><li>Progress tracking and analytics</li><li>Integration with HR systems</li></ul><h3>Target Users</h3><p>10,000+ employees across multiple departments and locations</p>', 1, 'active', NULL, NULL, NULL, '2026-01-18 18:38:26', '2026-01-18 18:38:26'),
(15, 'IoT Smart Home Dashboard', '<h2>Project Overview</h2><p>Centralized dashboard for managing and monitoring smart home IoT devices with automation capabilities.</p><h3>Supported Devices</h3><ul><li>Smart lighting and climate control</li><li>Security cameras and door locks</li><li>Energy monitoring and optimization</li><li>Voice assistant integration</li><li>Automated schedules and scenes</li></ul><h3>Technology</h3><p>Angular, Python Flask, MQTT, InfluxDB, Docker</p>', 1, '', NULL, NULL, NULL, '2026-01-18 18:38:26', '2026-01-18 18:38:26'),
