INSERT INTO `work_items` (`id`, `title`, `description`, `type`, `created_by`, `assigned_to`, `workflow_id`, `current_status_id`, `priority`, `due_date`, `project_id`, `metadata`, `created_at`, `updated_at`) VALUES
(1, 'API Test - Updated Task', 'The early morning light filtered through the city streets, casting long shadows across the quiet sidewalks. Cafs were just beginning to open, their doors releasing the comforting aroma of fresh coffee and baked bread. A few commuters passed by, moving with purpose, while the rest of the city slowly stirred awake.\r\n\r\nAs the day progressed, the streets grew louder and more colorful. Conversations overlapped with the hum of traffic, and storefronts displayed bright signs competing for attention. In the midst of the bustle, small moments of calm still appearedsomeone pausing to check the sky, or a street musician filling the air with a familiar tune.\r\n\r\nBy evening, the pace softened once again. Lights glowed warmly from apartment windows, and the noise faded into a distant murmur. The city settled into a quieter rhythm, holding the days memories as it prepared to begin all over again the next morning.', 'task', 1, NULL, 1, 4, 'medium', '2026-01-21', NULL, NULL, '2026-01-17 22:39:07', '2026-01-18 19:49:08'),
(2, 'A task with sample text from ChatGPT', 'Modern organizations rely on clear structure and well-defined systems to operate efficiently. When processes are easy to understand, teams can focus more on outcomes and less on coordination issues. Clarity is often the foundation of sustainable growth.\n\nTechnology plays a critical role in enabling this structure. Well-designed digital tools help standardize workflows, reduce manual effort, and create consistency across departments. Over time, these tools become central to how organizations function.\n\nHowever, systems are only as effective as the people who use them. Adoption improves when tools are intuitive and aligned with real-world needs. Successful solutions balance technical strength with human usability.\n\nAs organizations scale, flexibility becomes just as important as stability. Systems must adapt to new requirements without breaking existing processes. This balance allows businesses to evolve while maintaining operational reliability.\n\nUltimately, strong systems create confidence. They enable better decision-making, smoother collaboration, and long-term resilience. When structure and adaptability work together, organizations are better prepared for change.', 'task', 1, 1, 1, 2, 'urgent', '2026-01-29', 3, NULL, '2026-01-18 13:45:02', '2026-01-18 14:57:09'),
(3, 'Do this ASAP please. Systems are down!', '', 'task', 1, 1, 1, 1, 'high', '2026-02-19', 3, NULL, '2026-01-18 14:46:48', '2026-01-18 14:46:48'),
(4, 'Do this ASAP please. Systems are down!', '', 'task', 1, 1, 1, 2, 'high', '2026-02-19', 3, NULL, '2026-01-18 14:48:45', '2026-01-18 14:51:04'),
(5, 'Urgently need this task to be carried out', '', 'leave_request', 1, 1, 2, 6, 'high', '2026-01-09', 3, NULL, '2026-01-18 14:55:02', '2026-01-18 14:55:02');
