INSERT INTO `work_items` (`id`, `title`, `description`, `type`, `created_by`, `assigned_to`, `workflow_id`, `current_status_id`, `priority`, `due_date`, `project_id`, `metadata`, `created_at`, `updated_at`) VALUES
(8, 'This is a leave request for Hajj', '<p>Modern organizations rely on clear structure and well-defined systems to operate efficiently. When processes are easy to understand, teams can focus more on outcomes and less on coordination issues. Clarity is often the foundation of sustainable growth.</p><p>Technology plays a critical role in enabling this structure. Well-designed digital tools help standardize workflows, reduce manual effort, and create consistency across departments. Over time, these tools become central to how organizations function.</p><p>However, systems are only as effective as the people who use them. Adoption improves when tools are intuitive and aligned with real-world needs. Successful solutions balance technical strength with human usability.</p><p>As organizations scale, flexibility becomes just as important as stability. Systems must adapt to new requirements without breaking existing processes. This balance allows businesses to evolve while maintaining operational reliability.</p><p>Ultimately, strong systems create confidence. They enable better decision-making, smoother collaboration, and long-term resilience. When structure and adaptability work together, organizations are better prepared for change.</p>', 'leave_request', 1, 1, 2, 6, 'medium', '2026-01-22', 8, NULL, '2026-01-18 15:46:57', '2026-01-18 18:49:54');
INSERT INTO `work_items` (`id`, `title`, `description`, `type`, `created_by`, `assigned_to`, `workflow_id`, `current_status_id`, `priority`, `due_date`, `project_id`, `metadata`, `created_at`, `updated_at`) VALUES
(9, 'A work item associated with the newly created project', '<p>Every successful project begins with a clear vision. Defining goals early helps teams align their efforts and avoid unnecessary complexity. When direction is shared, progress becomes easier to measure and sustain.</p><p>Communication is the bridge between planning and execution. Transparent updates and open feedback reduce misunderstandings and strengthen collaboration. Strong communication turns individual contributions into collective momentum.</p><p>Consistency plays a key role in building trust. Whether in services, products, or internal operations, predictable outcomes create confidence among users and stakeholders. Over time, consistency becomes a defining characteristic of reliability.</p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\" width=\"465\" style=\"\"></p><p>Innovation, however, requires room for experimentation. Organizations that encourage curiosity and learning are better equipped to respond to change. Small, thoughtful improvements often lead to meaningful long-term impact.</p><p>In the end, balance defines success. Combining clarity with flexibility, structure with creativity, allows teams to grow without losing focus. This balance is what transforms good ideas into lasting results.</p>', 'task', 1, 1, 1, 1, 'high', '2026-01-30', 8, NULL, '2026-01-18 15:53:53', '2026-01-18 18:49:54');
