(10, 'API Test Task - Automated', '<p>This task was created by the automated API testing script.</p><h3>Test Objectives:</h3><ul><li>Validate task creation</li><li>Test rich text support</li><li>Verify API response structure</li></ul>', 'task', 1, NULL, 1, 1, 'high', '2026-02-15', 8, NULL, '2026-01-18 18:18:04', '2026-01-18 18:49:55'),
